var title_f31_37_32345="Spine anatomy overview";
var content_f31_37_32345=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F64902&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F64902&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 656px\">",
"   <div class=\"ttl\">",
"    Spine anatomy overview",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 636px; height: 549px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) This anterior view shows the isolated vertebral column.",
"    <br>",
"     (B) This right lateral view shows the isolated vertebral column. The isolated vertebrae are typical of each of the three mobile regions. Note the increase in size of the vertebrae as the column descends.",
"     <br>",
"      (C) This posterior view of the vertebral column includes the vertebral ends of ribs, representing the skeleton of the back.",
"      <br>",
"       (D) This medial view of the axial skeleton in situ demonstrates its regional curvatures and its relationship to the cranium (skull), thoracic cage, and hip bone. The continuous, weight-bearing column of vertebral bodies and IV discs forms the anterior wall of the vertebral canal. The lateral and posterior walls of the canal are formed by the series of vertebral arches. The IV foramina (seen also in part B) are openings in the lateral wall through which spinal nerves exit the vertebral canal. The posterior wall is formed by overlapping laminae and spinous processes, like shingles on a roof.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Reproduced with permission from: Moore KL, Dalley AF. Clinically Oriented Anatomy, 5th ed, Lippincott Williams &amp; Wilkins, Philadelphia 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"       </div>",
"       <div class=\"contractual\">",
"        <br/>",
"        <a href=\"file://www.lww.com\">",
"         file://www.lww.com",
"        </a>",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
