var title_f31_37_32347="Suggestions time zone shift";
var content_f31_37_32347=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F54556&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F54556&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for time zone shifts",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        1. Try to choose daytime flights to minimize sleep loss.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. If traveling at night or for long distance, try to travel in business or first class to allow sleep during the flight.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. Avoid large meals, caffeine, and alcohol during your normal sleep period.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Drink water.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. If the flight is 8 hours or more in length and occurs during your destination sleep period, consider the use of a short-acting hypnotic during the flight (this would contraindicate the use of any alcohol during the flight) and for the first few nights after arrival.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. Some research suggests that melatonin can help to alter circadian rhythms. Usage guidelines are available, but melatonin is sold only as a health food substance and is not approved by the FDA. Typical use is 5 mg at the desired bedtime for 4 nights after arrival in a new time zone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        7. Avoid important meetings on the day after arrival.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        8. Avoid distance driving or other sedentary behavior on the day of arrival.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        9. Bright light can either maintain or help to shift circadian rhythms depending upon the time of exposure.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Arendt, J, Stone, B, Skene, DJ. Sleep disruption in jet lag and other circadian rhythm-related disorders. In: Principles and practice of sleep medicine, 4th ed, Kryger, M, Roth, T, Dement, WC (eds), Saunders, New York 2005.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
